import React from "react";

function Pagefive() {
  return (
    <div
      style={{ display: "flex", alignItems: "center", flexDirection: "column" }}
    >
      <p>Our Works</p>
      <h3>Our Case Studies</h3>
    </div>
  );
}

export default Pagefive;
